#!/api/Titanium.Network-property-WRITE_MODE' class='name expandable'>WRITE_MODE</a><span> : Number</span><strong class='deprecated signature' >deprecated</strong><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'>@platform iphone 0.1\n@platform ipad 0.1\n\nConstant value specifying write-only mode for sockets. ...</div><div class='long'><p>@platform iphone 0.1\n@platform ipad 0.1</p>\n\n<p>Constant value specifying write-only mode for sockets.</p>\n\n        <div class='signature-box deprecated'>\n        <p>This property has been <strong>deprecated</strong> </p>\n        <p>1.7.0 <p>Used with the deprecated <a href=\"#!/api/Titanium.Network.TCPSocket\" rel=\"Titanium.Network.TCPSocket\" class=\"docClass\">Titanium.Network.TCPSocket</a> only.</p></p>\n\n<p>See <a href=\"#!/api/Titanium.Network.Socket\" rel=\"Titanium.Network.Socket\" class=\"docClass\">Titanium.Network.Socket</a> for constants used with\n<a href=\"#!/api/Titanium.Network.Socket.TCP\" rel=\"Titanium.Network.Socket.TCP\" class=\"docClass\">Titanium.Network.Socket.TCP</a> sockets.</p>\n\n\n        </div>\n</div></div></div><div id='property-bubbleParent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a><br/><a href='source/titanium.html#Titanium-Proxy-property-bubbleParent' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Proxy-property-bubbleParent' class='name expandable'>bubbleParent</a><span> : Boolean</span></div><div class='description'><div class='short'>@platform iphone 3.0\n@platform ipad 3.0\n@platform android 3.0\n\nIndicates if the proxy will bubble an event to its par...</div><div class='long'><p>@platform iphone 3.0\n@platform ipad 3.0\n@platform android 3.0</p>\n\n<p>Indicates if the proxy will bubble an event to its parent.</p>\n\n\n<p>@description <p>Some proxies (most commonly views) have a relationship to other proxies, often\nestablished by the add() method. For example, for a button added to a window, a\nclick event on the button would bubble up to the window. Other common parents are\ntable sections to their rows, table views to their sections, and scrollable views\nto their views. Set this property to false to disable the bubbling to the proxy's parent.</p></p>\n<p>Defaults to: <code>true</code></p></div></div></div><div id='property-httpURLFormatter' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-property-httpURLFormatter' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-property-httpURLFormatter' class='name expandable'>httpURLFormatter</a><span> : Callback&lt;String&gt;</span></div><div class='description'><div class='short'>@platform mobileweb 1.8\n\nUser-defined function that is called everytime HTTPClient connects to a remote resource. ...</div><div class='long'><p>@platform mobileweb 1.8</p>\n\n<p>User-defined function that is called everytime HTTPClient connects to a remote resource.</p>\n\n\n<p>@description <p>The URL to connect to is passed in as the only function argument, and the function\nis expected to return a URL. The function should return <code>null</code> if an error occurs,\nwhich will cancel the HTTP request. </p></p>\n\n<p>This function allows URLs to be formatted for use with the application's proxy to \nget around cross domain issues.</p>\n\n</div></div></div><div id='property-networkType' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-property-networkType' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-property-networkType' class='name expandable'>networkType</a><span> : Number</span><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'>Network type value as a constant. ...</div><div class='long'><p>Network type value as a constant.</p>\n\n\n<p>@description <p>One of the <code>NETWORK</code> constants defined in <a href=\"#!/api/Titanium.Network\" rel=\"Titanium.Network\" class=\"docClass\">Titanium.Network</a>.</p></p>\n</div></div></div><div id='property-networkTypeName' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-property-networkTypeName' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-property-networkTypeName' class='name expandable'>networkTypeName</a><span> : String</span><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'>Network type as a String. ...</div><div class='long'><p>Network type as a String. Returns one of <code>NONE</code>, <code>WIFI</code>, <code>LAN</code>, <code>MOBILE</code>, or <code>UNKNOWN</code>.</p>\n\n</div></div></div><div id='property-online' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-property-online' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-property-online' class='name expandable'>online</a><span> : Boolean</span><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'>Boolean value indicating if the device can reach the Internet. ...</div><div class='long'><p>Boolean value indicating if the device can reach the Internet.</p>\n\n\n<p>@description <p>The <code>online</code> property is <code>true</code> if the device can currently reach the Internet\nusing either WiFi, mobile network or LAN.</p></p>\n</div></div></div><div id='property-remoteDeviceUUID' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-property-remoteDeviceUUID' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-property-remoteDeviceUUID' class='name expandable'>remoteDeviceUUID</a><span> : String</span><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'>@platform iphone 0.1\n@platform ipad 0.1\n\nRemote device UUID if the device is registered with the Apple Push Notificat...</div><div class='long'><p>@platform iphone 0.1\n@platform ipad 0.1</p>\n\n<p>Remote device UUID if the device is registered with the Apple Push Notification\nService, or null if it is not registered.</p>\n\n</div></div></div><div id='property-remoteNotificationTypes' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-property-remoteNotificationTypes' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-property-remoteNotificationTypes' class='name not-expandable'>remoteNotificationTypes</a><span> : Number[]</span><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'><p>@platform iphone 0.1\n@platform ipad 0.1</p>\n\n<p>Array of push notification type constants enabled for the application.</p>\n\n</div><div class='long'><p>@platform iphone 0.1\n@platform ipad 0.1</p>\n\n<p>Array of push notification type constants enabled for the application.</p>\n\n</div></div></div><div id='property-remoteNotificationsEnabled' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-property-remoteNotificationsEnabled' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-property-remoteNotificationsEnabled' class='name expandable'>remoteNotificationsEnabled</a><span> : Boolean</span><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'>@platform iphone 0.1\n@platform ipad 0.1\n\nIndicates whether push  notifications have been enabled using \nregisterForPu...</div><div class='long'><p>@platform iphone 0.1\n@platform ipad 0.1</p>\n\n<p>Indicates whether push  notifications have been enabled using \n<a href=\"#!/api/Titanium.Network-method-registerForPushNotifications\" rel=\"Titanium.Network-method-registerForPushNotifications\" class=\"docClass\">registerForPushNotifications</a>.</p>\n\n</div></div></div></div></div><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-method'>Methods</h3><div class='subsection'><div id='method-addConnectivityListener' class='member first-child not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-addConnectivityListener' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-addConnectivityListener' class='name expandable'>addConnectivityListener</a>( <span class='pre'>callback</span> ) : Object<strong class='removed signature' >removed</strong></div><div class='description'><div class='short'>Legacy method to add a connectivity listener to listen for network changes. ...</div><div class='long'><p>Legacy method to add a connectivity listener to listen for network changes.</p>\n\n        <div class='signature-box removed'>\n        <p>This method has been <strong>removed</strong> since 3.0.0</p>\n        <p>Use the <a href=\"#!/api/Titanium.Network-event-change\" rel=\"Titanium.Network-event-change\" class=\"docClass\">change</a> event to monitor connectivity changes.</p>\n\n\n        </div>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>callback</span> : Callback&lt;Object&gt;<div class='sub-desc'><p>Callback function to invoke upon network connectivity changes.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>void\n@platform iphone 0.1\n@platform ipad 0.1</p>\n</div></li></ul></div></div></div><div id='method-addEventListener' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a><br/><a href='source/titanium.html#Titanium-Proxy-method-addEventListener' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Proxy-method-addEventListener' class='name expandable'>addEventListener</a>( <span class='pre'>name, callback</span> ) : Object</div><div class='description'><div class='short'>Adds the specified callback as an event listener for the named event. ...</div><div class='long'><p>Adds the specified callback as an event listener for the named event.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : String<div class='sub-desc'><p>Name of the event.</p>\n\n</div></li><li><span class='pre'>callback</span> : Callback&lt;Object&gt;<div class='sub-desc'><p>Callback function to invoke when the event is fired.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>void</p>\n</div></li></ul></div></div></div><div id='method-applyProperties' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a><br/><a href='source/titanium.html#Titanium-Proxy-method-applyProperties' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Proxy-method-applyProperties' class='name expandable'>applyProperties</a>( <span class='pre'>props</span> ) : Object</div><div class='description'><div class='short'>Applies the properties to the proxy. ...</div><div class='long'><p>Applies the properties to the proxy.</p>\n\n\n<p>@description <p>Properties are supplied as a dictionary. Each key-value pair in the object is applied to the proxy such that\nmyproxy[key] = value.</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>props</span> : <a href=\"#!/api/Dictionary\" rel=\"Dictionary\" class=\"docClass\">Dictionary</a><div class='sub-desc'><p>A dictionary of properties to apply.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>void\n@platform android 3.0\n@platform iphone 3.0\n@platform ipad 3.0\n@platform mobileweb 3.0</p>\n</div></li></ul></div></div></div><div id='method-createBonjourBrowser' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-createBonjourBrowser' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-createBonjourBrowser' class='name expandable'>createBonjourBrowser</a>( <span class='pre'>serviceType, [domain], [parameters]</span> ) : <a href=\"#!/api/Titanium.Network.BonjourBrowser\" rel=\"Titanium.Network.BonjourBrowser\" class=\"docClass\">Titanium.Network.BonjourBrowser</a></div><div class='description'><div class='short'>Creates and returns a BonjourBrowser object. ...</div><div class='long'><p>Creates and returns a <code>BonjourBrowser</code> object.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>serviceType</span> : String<div class='sub-desc'><p>Service to search for, must include the protocol type suffix (._tcp).</p>\n\n</div></li><li><span class='pre'>domain</span> : String (optional)<div class='sub-desc'><p>Bonjour service domain to conduct the search in.</p>\n\n<p>Defaults to: <code>&lt;code&gt;local.&lt;/code&gt; (The trailing period is intentional.)</code></p></div></li><li><span class='pre'>parameters</span> : Dictionary&lt;Titanium.Network.BonjourBrowser&gt; (optional)<div class='sub-desc'><p>A dictionary object of properties defined in <a href=\"#!/api/Titanium.Network.BonjourBrowser\" rel=\"Titanium.Network.BonjourBrowser\" class=\"docClass\">Titanium.Network.BonjourBrowser</a>.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/Titanium.Network.BonjourBrowser\" rel=\"Titanium.Network.BonjourBrowser\" class=\"docClass\">Titanium.Network.BonjourBrowser</a></span><div class='sub-desc'><p>@platform iphone 0.1\n@platform ipad 0.1</p>\n</div></li></ul></div></div></div><div id='method-createBonjourService' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-createBonjourService' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-createBonjourService' class='name expandable'>createBonjourService</a>( <span class='pre'>name, type, [domain], [parameters]</span> ) : <a href=\"#!/api/Titanium.Network.BonjourService\" rel=\"Titanium.Network.BonjourService\" class=\"docClass\">Titanium.Network.BonjourService</a></div><div class='description'><div class='short'>Creates and returns a BonjourService object. ...</div><div class='long'><p>Creates and returns a <code>BonjourService</code> object.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : String<div class='sub-desc'><p>Name of the service. Must be a unique identifier for this service type and domain.</p>\n\n</div></li><li><span class='pre'>type</span> : String<div class='sub-desc'><p>Type of service.  Must include the protocol identifier (._tcp).</p>\n\n</div></li><li><span class='pre'>domain</span> : String (optional)<div class='sub-desc'><p>Domain to publish the service in.</p>\n\n<p>Defaults to: <code>&lt;code&gt;local.&lt;/code&gt; (The trailing period is intentional.)</code></p></div></li><li><span class='pre'>parameters</span> : Dictionary&lt;Titanium.Network.BonjourService&gt; (optional)<div class='sub-desc'><p>Dictionary object of properties defined in <a href=\"#!/api/Titanium.Network.BonjourService\" rel=\"Titanium.Network.BonjourService\" class=\"docClass\">Titanium.Network.BonjourService</a>.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/Titanium.Network.BonjourService\" rel=\"Titanium.Network.BonjourService\" class=\"docClass\">Titanium.Network.BonjourService</a></span><div class='sub-desc'><p>@platform iphone 0.1\n@platform ipad 0.1</p>\n</div></li></ul></div></div></div><div id='method-createHTTPClient' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-createHTTPClient' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-createHTTPClient' class='name expandable'>createHTTPClient</a>( <span class='pre'>[parameters]</span> ) : <a href=\"#!/api/Titanium.Network.HTTPClient\" rel=\"Titanium.Network.HTTPClient\" class=\"docClass\">Titanium.Network.HTTPClient</a></div><div class='description'><div class='short'>Creates and returns an instance of Titanium.Network.HTTPClient. ...</div><div class='long'><p>Creates and returns an instance of <a href=\"#!/api/Titanium.Network.HTTPClient\" rel=\"Titanium.Network.HTTPClient\" class=\"docClass\">Titanium.Network.HTTPClient</a>.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>parameters</span> : Dictionary&lt;Titanium.Network.HTTPClient&gt; (optional)<div class='sub-desc'><p>Properties to set on a new object, including any defined by <a href=\"#!/api/Titanium.Network.HTTPClient\" rel=\"Titanium.Network.HTTPClient\" class=\"docClass\">Titanium.Network.HTTPClient</a> except those marked not-creation or read-only.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/Titanium.Network.HTTPClient\" rel=\"Titanium.Network.HTTPClient\" class=\"docClass\">Titanium.Network.HTTPClient</a></span><div class='sub-desc'><p>@platform android 0.1\n@platform iphone 0.1\n@platform ipad 0.1\n@platform mobileweb 1.8</p>\n</div></li></ul></div></div></div><div id='method-createTCPSocket' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-createTCPSocket' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-createTCPSocket' class='name expandable'>createTCPSocket</a>( <span class='pre'>hostName, port, mode, parameters</span> ) : <a href=\"#!/api/Titanium.Network.TCPSocket\" rel=\"Titanium.Network.TCPSocket\" class=\"docClass\">Titanium.Network.TCPSocket</a><strong class='deprecated signature' >deprecated</strong></div><div class='description'><div class='short'>Legacy method to create and return an instance of Titanium.Network.TCPSocket. ...</div><div class='long'><p>Legacy method to create and return an instance of <a href=\"#!/api/Titanium.Network.TCPSocket\" rel=\"Titanium.Network.TCPSocket\" class=\"docClass\">Titanium.Network.TCPSocket</a>.</p>\n\n\n<p>@description <p>Note that <code>TCPSocket</code> is still used with the Bonjour services. For other uses,\nsee <a href=\"#!/api/Titanium.Network.Socket.TCP\" rel=\"Titanium.Network.Socket.TCP\" class=\"docClass\">Titanium.Network.Socket.TCP</a>.</p></p>\n        <div class='signature-box deprecated'>\n        <p>This method has been <strong>deprecated</strong> since 1.7.0</p>\n        <p>Use <a href=\"#!/api/Titanium.Network.Socket-method-createTCP\" rel=\"Titanium.Network.Socket-method-createTCP\" class=\"docClass\">Titanium.Network.Socket.createTCP</a> instead.</p>\n\n\n        </div>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>hostName</span> : String<div class='sub-desc'><p>Host name to connect to/listen on.</p>\n\n</div></li><li><span class='pre'>port</span> : Number<div class='sub-desc'><p>Port for the socket.</p>\n\n</div></li><li><span class='pre'>mode</span> : Number<div class='sub-desc'><p>Socket's mode; one of <a href=\"#!/api/Titanium.Network-property-READ_MODE\" rel=\"Titanium.Network-property-READ_MODE\" class=\"docClass\">READ_MODE</a>, <a href=\"#!/api/Titanium.Network-property-WRITE_MODE\" rel=\"Titanium.Network-property-WRITE_MODE\" class=\"docClass\">WRITE_MODE</a>, \n<a href=\"#!/api/Titanium.Network-property-READ_WRITE_MODE\" rel=\"Titanium.Network-property-READ_WRITE_MODE\" class=\"docClass\">READ_WRITE_MODE</a>.</p>\n\n</div></li><li><span class='pre'>parameters</span> : Dictionary&lt;Titanium.Network.TCPSocket&gt;<div class='sub-desc'><p>Dictionary object with properties defined in <a href=\"#!/api/Titanium.Network.TCPSocket\" rel=\"Titanium.Network.TCPSocket\" class=\"docClass\">Titanium.Network.TCPSocket</a>.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/Titanium.Network.TCPSocket\" rel=\"Titanium.Network.TCPSocket\" class=\"docClass\">Titanium.Network.TCPSocket</a></span><div class='sub-desc'><p>@platform iphone 0.1\n@platform ipad 0.1\n@platform mobileweb 1.8</p>\n</div></li></ul></div></div></div><div id='method-decodeURIComponent' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-decodeURIComponent' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-decodeURIComponent' class='name expandable'>decodeURIComponent</a>( <span class='pre'>value</span> ) : String</div><div class='description'><div class='short'>Returns a decoded version of a URI encoded value. ...</div><div class='long'><p>Returns a decoded version of a URI encoded value.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>value</span> : String<div class='sub-desc'><p>URI encoded input value to be decoded.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-encodeURIComponent' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-encodeURIComponent' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-encodeURIComponent' class='name expandable'>encodeURIComponent</a>( <span class='pre'>value</span> ) : String</div><div class='description'><div class='short'>Returns a URI encoded version of the specified URI component. ...</div><div class='long'><p>Returns a URI encoded version of the specified URI component.</p>\n\n\n<p>@description <p>On iOS, this also escapes the following characters, which are allowed in a\nURL but may not be allowed or desirable inside a path component:</p></p>\n\n<pre><code>!*'();:@+$,/?%#[]=&amp;\n</code></pre>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>value</span> : String<div class='sub-desc'><p>Input value to be encoded.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-fireEvent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a><br/><a href='source/titanium.html#Titanium-Proxy-method-fireEvent' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Proxy-method-fireEvent' class='name expandable'>fireEvent</a>( <span class='pre'>name, event</span> ) : Object</div><div class='description'><div class='short'>Fires a synthesized event to any registered listeners. ...</div><div class='long'><p>Fires a synthesized event to any registered listeners.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : String<div class='sub-desc'><p>Name of the event.</p>\n\n</div></li><li><span class='pre'>event</span> : <a href=\"#!/api/Dictionary\" rel=\"Dictionary\" class=\"docClass\">Dictionary</a><div class='sub-desc'><p>A dictionary of keys and values to add to the <a href=\"#!/api/Titanium.Event\" rel=\"Titanium.Event\" class=\"docClass\">Titanium.Event</a> object sent to the listeners.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>void</p>\n</div></li></ul></div></div></div><div id='method-getBubbleParent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a><br/><a href='source/titanium.html#Titanium-Proxy-method-getBubbleParent' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Proxy-method-getBubbleParent' class='name expandable'>getBubbleParent</a>( <span class='pre'></span> ) : Boolean</div><div class='description'><div class='short'>Gets the value of the bubbleParent property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Proxy-property-bubbleParent\" rel=\"Titanium.Proxy-property-bubbleParent\" class=\"docClass\">bubbleParent</a> property.</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'><p>@platform iphone 3.0\n@platform ipad 3.0\n@platform android 3.0</p>\n</div></li></ul></div></div></div><div id='method-getHttpURLFormatter' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-getHttpURLFormatter' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-getHttpURLFormatter' class='name expandable'>getHttpURLFormatter</a>( <span class='pre'></span> ) : Callback&lt;String&gt;</div><div class='description'><div class='short'>Gets the value of the httpURLFormatter property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Network-property-httpURLFormatter\" rel=\"Titanium.Network-property-httpURLFormatter\" class=\"docClass\">httpURLFormatter</a> property.</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Callback&lt;String&gt;</span><div class='sub-desc'><p>@platform mobileweb 1.8</p>\n</div></li></ul></div></div></div><div id='method-getNetworkType' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-getNetworkType' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-getNetworkType' class='name expandable'>getNetworkType</a>( <span class='pre'></span> ) : Number</div><div class='description'><div class='short'>Gets the value of the networkType property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Network-property-networkType\" rel=\"Titanium.Network-property-networkType\" class=\"docClass\">networkType</a> property.</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Number</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-getNetworkTypeName' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-getNetworkTypeName' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-getNetworkTypeName' class='name expandable'>getNetworkTypeName</a>( <span class='pre'></span> ) : String</div><div class='description'><div class='short'>Gets the value of the networkTypeName property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Network-property-networkTypeName\" rel=\"Titanium.Network-property-networkTypeName\" class=\"docClass\">networkTypeName</a> property.</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-getOnline' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-getOnline' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-getOnline' class='name expandable'>getOnline</a>( <span class='pre'></span> ) : Boolean</div><div class='description'><div class='short'>Gets the value of the online property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Network-property-online\" rel=\"Titanium.Network-property-online\" class=\"docClass\">online</a> property.</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-getRemoteDeviceUUID' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-getRemoteDeviceUUID' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-getRemoteDeviceUUID' class='name expandable'>getRemoteDeviceUUID</a>( <span class='pre'></span> ) : String</div><div class='description'><div class='short'>Gets the value of the remoteDeviceUUID property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Network-property-remoteDeviceUUID\" rel=\"Titanium.Network-property-remoteDeviceUUID\" class=\"docClass\">remoteDeviceUUID</a> property.</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>@platform iphone 0.1\n@platform ipad 0.1</p>\n</div></li></ul></div></div></div><div id='method-getRemoteNotificationTypes' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-getRemoteNotificationTypes' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-getRemoteNotificationTypes' class='name expandable'>getRemoteNotificationTypes</a>( <span class='pre'></span> ) : Number[]</div><div class='description'><div class='short'>Gets the value of the remoteNotificationTypes property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Network-property-remoteNotificationTypes\" rel=\"Titanium.Network-property-remoteNotificationTypes\" class=\"docClass\">remoteNotificationTypes</a> property.</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Number[]</span><div class='sub-desc'><p>@platform iphone 0.1\n@platform ipad 0.1</p>\n</div></li></ul></div></div></div><div id='method-getRemoteNotificationsEnabled' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-getRemoteNotificationsEnabled' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-getRemoteNotificationsEnabled' class='name expandable'>getRemoteNotificationsEnabled</a>( <span class='pre'></span> ) : Boolean</div><div class='description'><div class='short'>Gets the value of the remoteNotificationsEnabled property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Network-property-remoteNotificationsEnabled\" rel=\"Titanium.Network-property-remoteNotificationsEnabled\" class=\"docClass\">remoteNotificationsEnabled</a> property.</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'><p>@platform iphone 0.1\n@platform ipad 0.1</p>\n</div></li></ul></div></div></div><div id='method-registerForPushNotifications' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-registerForPushNotifications' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-registerForPushNotifications' class='name expandable'>registerForPushNotifications</a>( <span class='pre'>config</span> ) : Object</div><div class='description'><div class='short'>Registers for push notifications with the Apple Push Notification Service. ...</div><div class='long'><p>Registers for push notifications with the Apple Push Notification Service.</p>\n\n\n<p>@description <p>This method should be called at application startup.</p></p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>config</span> : <a href=\"#!/api/PushNotificationConfig\" rel=\"PushNotificationConfig\" class=\"docClass\">PushNotificationConfig</a><div class='sub-desc'><p>Dictionary specifying push-notification related options.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>void\n@platform iphone 0.1\n@platform ipad 0.1</p>\n</div></li></ul></div></div></div><div id='method-removeConnectivityListener' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-removeConnectivityListener' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-removeConnectivityListener' class='name expandable'>removeConnectivityListener</a>( <span class='pre'>callback</span> ) : Object<strong class='removed signature' >removed</strong></div><div class='description'><div class='short'>Legacy method to remove a connectivity listener. ...</div><div class='long'><p>Legacy method to remove a connectivity listener.</p>\n\n        <div class='signature-box removed'>\n        <p>This method has been <strong>removed</strong> since 3.0.0</p>\n        <p>Use the <a href=\"#!/api/Titanium.Network-event-change\" rel=\"Titanium.Network-event-change\" class=\"docClass\">change</a> event to monitor connectivity changes.</p>\n\n\n        </div>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>callback</span> : Callback&lt;Object&gt;<div class='sub-desc'><p>Callback function to remove.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>void\n@platform iphone 0.1\n@platform ipad 0.1</p>\n</div></li></ul></div></div></div><div id='method-removeEventListener' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a><br/><a href='source/titanium.html#Titanium-Proxy-method-removeEventListener' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Proxy-method-removeEventListener' class='name expandable'>removeEventListener</a>( <span class='pre'>name, callback</span> ) : Object</div><div class='description'><div class='short'>Removes the specified callback as an event listener for the named event. ...</div><div class='long'><p>Removes the specified callback as an event listener for the named event.</p>\n\n\n<p>@description <p>Multiple listeners can be registered for the same event, so the\n<code>callback</code> parameter is used to determine which listener to remove. </p></p>\n\n<p>When adding a listener, you must save a reference to the callback function\nin order to remove the listener later:</p>\n\n\n<pre><code>var listener = function() { Ti.API.info(\"Event listener called.\"); }\nwindow.addEventListener('click', listener);\n</code></pre>\n\n\n<p>To remove the listener, pass in a reference to the callback function:</p>\n\n\n<pre><code>window.removeEventListener('click', listener);\n</code></pre>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : String<div class='sub-desc'><p>Name of the event.</p>\n\n</div></li><li><span class='pre'>callback</span> : Callback&lt;Object&gt;<div class='sub-desc'><p>Callback function to remove. Must be the same function passed to <code>addEventListener</code>.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>void</p>\n</div></li></ul></div></div></div><div id='method-setBubbleParent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a><br/><a href='source/titanium.html#Titanium-Proxy-method-setBubbleParent' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Proxy-method-setBubbleParent' class='name expandable'>setBubbleParent</a>( <span class='pre'>bubbleParent</span> ) : Object</div><div class='description'><div class='short'>Sets the value of the bubbleParent property. ...</div><div class='long'><p>Sets the value of the <a href=\"#!/api/Titanium.Proxy-property-bubbleParent\" rel=\"Titanium.Proxy-property-bubbleParent\" class=\"docClass\">bubbleParent</a> property.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>bubbleParent</span> : Boolean<div class='sub-desc'><p>New value for the property.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>void\n@platform iphone 3.0\n@platform ipad 3.0\n@platform android 3.0</p>\n</div></li></ul></div></div></div><div id='method-setHttpURLFormatter' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-setHttpURLFormatter' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-setHttpURLFormatter' class='name expandable'>setHttpURLFormatter</a>( <span class='pre'>httpURLFormatter</span> ) : Object</div><div class='description'><div class='short'>Sets the value of the httpURLFormatter property. ...</div><div class='long'><p>Sets the value of the <a href=\"#!/api/Titanium.Network-property-httpURLFormatter\" rel=\"Titanium.Network-property-httpURLFormatter\" class=\"docClass\">httpURLFormatter</a> property.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>httpURLFormatter</span> : Callback&lt;String&gt;<div class='sub-desc'><p>New value for the property.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>void\n@platform mobileweb 1.8</p>\n</div></li></ul></div></div></div><div id='method-unregisterForPushNotifications' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-method-unregisterForPushNotifications' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-method-unregisterForPushNotifications' class='name expandable'>unregisterForPushNotifications</a>( <span class='pre'></span> ) : Object</div><div class='description'><div class='short'>Unregisters the application for push notifications. ...</div><div class='long'><p>Unregisters the application for push notifications.</p>\n\n\n<p>@description <p>Per Apple's documentation, it is rarely necessary to call this method. See:\n<a href=\"http://developer.apple.com/library/IOs/#documentation/UIKit/Reference/UIApplication_Class/Reference/Reference.html#//apple_ref/occ/instm/UIApplication/unregisterForRemoteNotifications\">unregisterForRemoteNotifications in the UIApplication Class\nReference</a> </p></p>\n\n<p>For example, calling this method would be required if a new version of \nyour application no longer supports push notifications.</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>void</p>\n</div></li></ul></div></div></div></div></div><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-event'>Events</h3><div class='subsection'><div id='event-change' class='member first-child not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.Network'>Titanium.Network</span><br/><a href='source/titanium.html#Titanium-Network-event-change' target='_blank' class='view-source'>view source</a></div><a href='#!/api/Titanium.Network-event-change' class='name expandable'>change</a>( <span class='pre'>, , networkType, networkTypeName, online, , source, type</span> )</div><div class='description'><div class='short'>Fired when network connectivity changes. ...</div><div class='long'><p>Fired when network connectivity changes.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'></span> : Boolean<div class='sub-desc'><p>(iphone ipad android) bubbles</p>\n\n<p>True if the event will try to bubble up if possible.</p>\n\n</div></li><li><span class='pre'></span> : Boolean<div class='sub-desc'><p>(iphone ipad android) cancelBubble</p>\n\n<p>Set to true to stop the event from bubbling.</p>\n\n</div></li><li><span class='pre'>networkType</span> : Number<div class='sub-desc'><p>New network type, one of the <code>NETWORK</code> constants defined in <a href=\"#!/api/Titanium.Network\" rel=\"Titanium.Network\" class=\"docClass\">Titanium.Network</a>.</p>\n\n</div></li><li><span class='pre'>networkTypeName</span> : String<div class='sub-desc'><p>New network type as a string.</p>\n\n</div></li><li><span class='pre'>online</span> : Boolean<div class='sub-desc'><p>Boolean to indicate if the device is online.</p>\n\n</div></li><li><span class='pre'></span> : String<div class='sub-desc'><p>(android mobileweb) reason</p>\n\n<p>Human-readable text describing the reason for the change.</p>\n\n</div></li><li><span class='pre'>source</span> : Object<div class='sub-desc'><p>Source object that fired the event.</p>\n\n</div></li><li><span class='pre'>type</span> : String<div class='sub-desc'><p>Name of the event fired.</p>\n\n</div></li></ul></div></div></div></div></div></div></div>"});